document.addEventListener("DOMContentLoaded",()=>{let e=Array.from(document.querySelectorAll('[class*="id-"]'));e.forEach(e=>{e.addEventListener("mouseover",()=>{let t=e.className.split(" ").find(e=>e.startsWith("id-")).substring(3);if(0!=t){let e=document.querySelectorAll(".id-"+t);e.forEach(e=>e.classList.add("bracket-highlight"))}}),e.addEventListener("mouseout",()=>{let t=e.className.split(" ").find(e=>e.startsWith("id-")).substring(3);if(0!=t){let e=document.querySelectorAll(".id-"+t);e.forEach(e=>e.classList.remove("bracket-highlight"))}})});let t=document.querySelectorAll(".ranking-color");t.forEach(function(e){window.getComputedStyle(e,null).getPropertyValue("background-color")})});var current_url=window.location.href;check_url=current_url.replace(window.location.origin,""),jQuery(".roundmenu-title").each(function(){var e=jQuery(this).attr("href");e===check_url&&jQuery(this).addClass("current")});